import React from 'react'

function About(){
    return(
        <React.Fragment>
            <h1>About</h1>
            <p>where my-app is the name of the folder for your application. This may take a few minutes to create the React application and install its dependencies.
            Let's quickly run our React application by navigating to the new folder and typing npm start to start the web server and open the application in a browser:</p>
        </React.Fragment>
    )
}



export default About;
